	@Override
	public void GetNorms(NormContainerMgr normContainerMgr) {
		NormContainerMgr = normContainerMgr;
	}

	public static INormMgr GetInstance() {
		if (mInstance == null) {
			mInstance = new NormMgr();
		}
		return mInstance;
	}

	public INormData GetNormDataByParamName(String name, String instruction) {
		double popMean = NormContainerMgr.GetNumericNormPopMean(instruction, name);
		double popSd = NormContainerMgr.GetNumericNormPopSd(instruction, name);
		double internalSd = NormContainerMgr.GetNumericNormInternalSd(instruction, name);

		INormData normData = new NormData(name, popMean, popSd, internalSd);

		return normData;
	}
	
	public INormData GetNormDataByParamName(String name, String instruction, int strokeIdx) {
		double popMean = NormContainerMgr.GetNumericNormPopMean(instruction, name, strokeIdx);
		double popSd = NormContainerMgr.GetNumericNormPopSd(instruction, name, strokeIdx);
		double internalSd = NormContainerMgr.GetNumericNormInternalSd(instruction, name, strokeIdx);

		INormData normData = new NormData(name, popMean, popSd, internalSd);

		return normData;
	}

	protected void CreateDoubleNorm(String name, String instruction, double mean, double standardDev,
			double internalStandardDev) {
		String key = CreateNormKey(name, instruction);
		mHashNorms.put(key, new NormData(name, mean, standardDev, internalStandardDev));
	}

	protected String CreateNormKey(String name, String instruction) {
		String key = String.format("%s-%s", name, instruction);
		return key;
	}
